import React, { useState } from 'react'
import { useSelector } from 'react-redux'


const Confirmation = (props) => {


    const bookedInfo = useSelector(state => state.seats.info)

    return(bookedInfo.map(result=>{
        return(
            <table>
                <tbody>
                    <tr>
                        <td>result.name</td>
                        <td>result.age</td>
                    </tr>

                </tbody>
            </table>
        )
    }))

}     
export default Confirmation;
